	(1,2,'2012-08-28 15:52:15','2012-08-28 15:52:15','Welcome to WordPress. This is your first post. Edit or delete it, then start blogging!','Hello world!','','publish','open','open','','hello-world','','','2012-08-28 15:52:15','2012-08-28 15:52:15','',0,'http://peacealliance.dev.cshp.co//cms/?p=1',0,'post','',1),
	(2,2,'2012-08-28 15:52:15','2012-08-28 15:52:15','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with a<strong>n About page that introduces them to potential site visitors. It might say so</strong>mething like this:\r\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my blog. I live in Los Angeles, have a great dog named Jack, and I like pia coladas. (And gettin\' caught in the rain.)</blockquote>\r\n...or something like this:\r\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickies to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\r\nAs a new WordPress user, you should go to <a href=\"http://peacealliance.dev.cshp.co//cms/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!','Sample Page','','publish','open','open','password','sample-page','','','2013-01-29 13:15:22','2013-01-29 20:15:22','',0,'http://peacealliance.dev.cshp.co//cms/?page_id=2',0,'page','',0),
